      <div className="AppPanel">
          <Router>
            <SideBarComponent></SideBarComponent> 
            <Header></Header> 
{/* 
            {
               pathList.map(data => {
                return (
                  <Route path={data.path} component={data.component} />
                )
              })
            } */}

        </Router>
      </div>
    );

}

export default Layout;
